import React, {Fragment} from 'react';
import Header from "../../components/Helpers/Header/Header";
import {Grid} from "@material-ui/core";
import DashboardDrawer from "../../components/DashboardDrawer/DashboardDrawer";
import {BrowserRouter, Route, Switch, Redirect} from "react-router-dom";
import AdminSection from "../AdminSection/AdminSection";
import AnnouncementList from "../../components/Announcements/AnnouncementList";
import StudentProfile from "../../components/StudentProfile/StudentProfile";

const Dashboard = props => {
    return (
        <Fragment>
          <Header />
          <Grid container spacing={2}>
            <Grid item xs={1} style={{ marginLeft: -8 }}>
              <DashboardDrawer />
            </Grid>
            <Grid item xs={11}>

                  <Route path={"/dashboard"} component={<AdminSection />} />
                  <Route path={"/dashboard/announcements"} component={<AnnouncementList />} />
                  <Route path={"/dashboard/profile"} component={<StudentProfile />} />
                  <Redirect to="/dashboard"/>
            </Grid>
          </Grid>
        </Fragment>
    )
}

export default Dashboard;
